const Sidebar = ({ open, onClose }) => {
  return (
    <div className={`linear fixed !z-50 flex min-h-full flex-col bg-white pb-10 md:!z-50 lg:!z-50 xl:!z-0`}>

      <div className={`text-center font-poppins font-bold uppercase`}>
        Stardex
      </div>

      <div class="mt-4 mb-7 h-px bg-gray-300" />
      {/* Nav item */}

      <ul className="mb-auto pt-1">
        <Links routes={routes} />
      </ul>

      {/* Nav item end */}
    </div>
  );
};

export default Sidebar;
